class Slider {
    constructor(containerId, config = {}) {
        this.config = {
            images: config.images || [],
            transitionSpeed: config.transitionSpeed || 500,
            autoplay: config.autoplay !== false,
            showArrows: config.showArrows !== false,
            showDots: config.showDots !== false,
            autoplayInterval: config.autoplayInterval || 5000,
        };

        this.container = document.getElementById(containerId);
        this.currentSlide = 0;
        this.slideInterval = null;

        this.init();
    }

    init() {
        this.container.innerHTML = `
                    <div class="slider-container">
                        <div class="slider"></div>
                        ${this.config.showArrows
                ? `
                            <button class="btn" id="prevBtn">←</button>
                            <button class="btn" id="nextBtn">→</button>
                        `
                : ""
            }
                    </div>
                    ${this.config.showDots
                ? '<div class="dots-container" id="dotsContainer"></div>'
                : ""
            }
                `;

        this.slider = this.container.querySelector(".slider");
        this.prevBtn = this.container.querySelector("#prevBtn");
        this.nextBtn = this.container.querySelector("#nextBtn");
        this.dotsContainer = this.container.querySelector("#dotsContainer");

        this.config.images.forEach((img, index) => {
            const slide = document.createElement("div");
            slide.className = "slide";
            slide.style.backgroundColor = this.getRandomLightColor();
            slide.innerHTML = `
                        <img src="${img}" alt="Slide ${index + 1}">
                        <h2>Слайд ${index + 1}</h2>
                        <p>Це слайд номер ${index + 1}</p>
                    `;
            this.slider.appendChild(slide);
        });

        this.slides = this.container.querySelectorAll(".slide");
        this.slideCount = this.slides.length;

        if (this.config.showDots) {
            this.slides.forEach((_, index) => {
                const dot = document.createElement("div");
                dot.className = "dot";
                if (index === 0) dot.classList.add("active");
                dot.addEventListener("click", () => this.goToSlide(index));
                this.dotsContainer.appendChild(dot);
            });
            this.dots = this.container.querySelectorAll(".dot");
        }

        if (this.config.showArrows) {
            this.prevBtn.addEventListener("click", () =>
                this.goToSlide(this.currentSlide - 1)
            );
            this.nextBtn.addEventListener("click", () =>
                this.goToSlide(this.currentSlide + 1)
            );
        }

        document.addEventListener("keydown", (e) => {
            if (e.key === "ArrowLeft") this.goToSlide(this.currentSlide - 1);
            else if (e.key === "ArrowRight") this.goToSlide(this.currentSlide + 1);
        });

        if (this.config.autoplay) this.startAutoplay();

        this.slider.addEventListener("mouseenter", () => this.stopAutoplay());
        this.slider.addEventListener("mouseleave", () => this.startAutoplay());
    }

    goToSlide(slideIndex) {
        if (slideIndex < 0) slideIndex = this.slideCount - 1;
        else if (slideIndex >= this.slideCount) slideIndex = 0;

        this.slider.style.transition = `transform ${this.config.transitionSpeed}ms ease-in-out`;
        this.slider.style.transform = `translateX(-${slideIndex * 100}%)`;
        this.currentSlide = slideIndex;

        if (this.config.showDots) {
            this.dots.forEach((dot, index) => {
                dot.classList.toggle("active", index === this.currentSlide);
            });
        }
    }

    startAutoplay() {
        if (this.slideInterval) clearInterval(this.slideInterval);
        this.slideInterval = setInterval(
            () => this.goToSlide(this.currentSlide + 1),
            this.config.autoplayInterval
        );
    }

    stopAutoplay() {
        if (this.slideInterval) clearInterval(this.slideInterval);
    }

    getRandomLightColor() {
        const hue = Math.floor(Math.random() * 360);
        return `hsl(${hue}, 80%, 90%)`;
    }
}

const mySlider = new Slider("mySlider", {
    images: [
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
    ],
    transitionSpeed: 600,
    autoplay: true,
    showArrows: true,
    showDots: true,
    autoplayInterval: 3000,
});
